// Detecting whether we're on the cart page and get the cart info
Ecwid.OnPageLoaded.add(function(page) {
  widgets = Ecwid.getInitializedWidgets();

  	$('.c-ecwid_item').addClass('-page-load')

	if($('.ecwid-ProductBrowser-auth-logged-name').length) {
		$('.ecwid-productBrowser-auth-signOutLink').show();
		$('.c-connect').hide();
		$('.c-order_li').removeClass('-not-connected');
		$('.c-account').removeClass('-not-connected');
		$('.c-address_li').removeClass('-not-connected');
		$('.c-address').removeClass('-not-connected');
		$('.c-logout').removeClass('-not-connected');		
		$('.c-account').show();
	} else {
		$('.c-account').hide();
		$('.c-order_li').addClass('-not-connected');
		$('.c-account').addClass('-not-connected');
		$('.c-address_li').addClass('-not-connected');
		$('.c-address').addClass('-not-connected');
		$('.c-logout').addClass('-not-connected');

	}

});


Ecwid.OnPageLoad.add(function(page){
$('.c-products').removeClass("-js-c-category");
$('.c-products').removeClass("-js-c-product");

	console.log(page.type);



setTimeout(function() {
  console.log("Current page is of type: " + page.type);
    if (page.type == "CATEGORY" || page.type == "SEARCH"|| page.type == "FAVORITES") { 
    	$('.c-products').addClass('-js-c-category');
    } else if (page.type == "PRODUCT" || page.type == "CART") {
		$('.c-products').addClass('-js-c-product');
  	}
  	$('.ecwid-productBrowser-head').append('<h2>' + $('.ecwid-productBrowser-head').html() + '</h2');
},100);


});


// A drop-in HTML/JS script for Ecwid to force logout after an order is placed
if (typeof(Ecwid) == 'object') {
  Ecwid.OnPageLoaded.add(function(page) {


  	$('html').addClass('-ecwid-load');

$('.c-special').addClass('ecwid-loaded');


	$('.ecwid-productBrowser-auth-signOutLink').on('click',function() {
      var localStoragePrefix = 'PSecwid__' + Ecwid.getOwnerId() + 'PS';
      var isLoggedIn = (localStorage.getItem(localStoragePrefix + 'token') != null);
      if (isLoggedIn) {
        var itemsToRemove = ['token','customerid','profile'];
        for (var i = 0; i < itemsToRemove.length; i++) {
          localStorage.removeItem(localStoragePrefix + itemsToRemove[i]);
        }
        window.location.reload(true);
      }
    });
  });
}

    



